import React from "react";

import ButtonComponent from "./buttonComponent";

const RecentItems = ({ postData }) => {
  return (
    <div className="recent-item">
      <div className="recent-img-container">
        <img src={require("../images/activity.jpg")} alt="Activity Sample" />
      </div>
      <div className="recent-details-container">
        <h1>{postData.title}</h1>
        <h2>{postData.date}</h2>
        <p>{postData.body}</p>
        <ButtonComponent className="left" action="Link" title="Read More" />
      </div>
    </div>
  );
};

export default RecentItems;
